  return(
    <div>
    <Grid columns={1} verticalAlign="top">
      <Grid.Column>
        <Grid.Row>
          <div style={{backgroundColor: "#054F9E", height: 80}}>
            <img src={require("../assets/kadena.png")} style={{height:50, margin: 10, marginLeft: 80}}/>
